import React, {useState, useEffect} from 'react';
import styled from '@emotion/styled';

const Wrapper = styled.div`
z-index:100;
width:100%;
height:100%;
display:flex;
justify-content:center;
align-items:center;
`

const Box = styled.div`
background:blue;
width:50vw;
height:75vh;
`

const Card = () => {
    return(
        <Wrapper/>
    )
}

export default Card;
